import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";
import { Categories } from "../../../../Data/data";

const HealthBeauty = () => {
    return (
        <div>
            <Row>
                <Col className="mm">
                    <Link to="health-beauty">
                        <span className="fa-solid fa-eye-dropper"></span>
                        HealthBeauty
                        <span className="right-arrow fa-solid fa-caret-right"></span>
                    </Link>
                </Col>
                <div className="hover-menu">
                    <div className="hover-menu-flex" >
                        <Col className="column" lg='4'>
                            <ul>
                                <div>PERSONAL CARE</div>
                                {Categories.HealthBeauty[0].PERSONAL_CARE?.map((item) => {
                                    return (
                                        <li><Link to={item.to}>{item.title}</Link></li>
                                    )
                                })}
                            </ul>
                            <ul>
                                <div>SKIN CARE</div>
                                {Categories.HealthBeauty[0].PERSONAL_CARE?.map((item) => {
                                    return (
                                        <li><Link to={item.to}>{item.title}</Link></li>
                                    )
                                })}
                            </ul>
                        </Col>
                        <Col className="column" lg='4'>
                            <ul>
                                <div>HAIR CARE</div>
                                <li><Link to='HealthBeauty/styling-tools'>Styling Tools & Appliances</Link></li>
                                <li><Link to='HealthBeauty/styling-products'>Hair Styling Products</Link></li>
                                <li><Link to='HealthBeauty/shampoo-conditioner'>Shampoo, Conditioner & Serums</Link></li>
                            </ul>
                            <ul>
                                <div>HEALTH CARE</div>
                                <li><Link to='HealthBeauty/wellness-relaxation'>Wellness & Relaxation</Link></li>
                                <li><Link to='HealthBeauty/medical-supplies-equipment'>Medical Supplies & Equipment</Link></li>
                            </ul>
                        </Col>
                    </div>
                </div>
            </Row>
        </div>
    )
}
export default HealthBeauty;
